#!/usr/bin/env python3
import sys


def solve(S: str, T: str):
    for ss, tt in zip(S, T):
        if ss == tt:
            continue
        if ss == "@":
            if tt in "atcoder":
                continue
        if tt == "@":
            if ss in "atcoder":
                continue
        print("You will lose")
        return
    print("You can win")
    return


